import React from 'react'
import { Outlet, Link } from "react-router-dom";
import {GlobalStyle, StyledFieldset, StyledButton} from "./components/Style.js"

function Survey() {
  return (
    <>
    <GlobalStyle/>
      <nav>
        <ul>
          <div>
            <StyledButton to="/Home">Click here to start the survey</StyledButton>
          </div>
        </ul>
      </nav>

      <Outlet />

    </>
  )
}

export default Survey;
